import React, { Component } from 'react'

export default class NowPlaying extends Component {
    constructor(props) {
        super(props);
        this.state = {
            playbackState: {}
        }

    }

    componentDidMount() {
        this.props.getPlayback()
            .then(result => {
                this.setState({playbackState: result});
            });

        console.log(this.state.playbackState);
    }

    render() {

        return (
            <div>
                <div style={{fontFamily: 'Roboto Slab, serif'}}>#NP:</div>
                <div style={{fontFamily: 'Roboto Slab, serif'}}></div>
            </div>
        )
    }
}
